window.bookSummaryJSON = "<p>When an immortal falls, worlds will tremble…</p> <p>The Roman god Janus was destroyed by his fellow gods, only to be resurrected thousands of years later—thanks to his modern descendant, a mere mortal. Throughout the Undercover Elementals series, Janus has remained an enigma. He holds dominion over all elementals and zealously guards the doorways to the Unseen realm. No one, not even Janus, will abuse that power.<br> Until one woman tempts him to break his vows…<br> A beautiful yet vexing mortal has captivated Janus. But a fiercely powerful dark force will do anything to keep them apart.<br> Time itself might be obliterated…<br> The most powerful beings in the Unseen compel Janus to undertake a perilous, time-bending mission to discover the truth about his own past.<br> A wild, passionate bond ignites…<br> When events force the god and the mortal to stay together, no one can predict how their quest will end. In glory? Or in apocalyptic destruction?<br> The Immortal Falls is the eighth book in the Undercover Elementals series of steamy, thrilling paranormal romance.</p>"; 
